begin{algorithm}
\caption{Algorithm to find if there is an element such that $A[i]=i$}\label{euclid}
\begin{algorithmic}[1]
\Procedure{getIndex $(A, low, high)$}{}
\If {$low == high$}
	\If {$A[low] == low$}
		\State \textbf{return} $low$.
		\Else
		\State \textbf {return} $-1$.
	\EndIf
\EndIf
\State $mid \gets (low+high)/2$.
\If {$A[mid]>mid$}
		\State \textbf{Call} $getIndex(A,low, mid-1)$
\ElsIf {$A[mid]<mid$} 
		\State \textbf{Call} $getIndex(A,mid+1, high)$
\Else 
		\State \textbf{return} $mid$
\EndIf

\EndProcedure
\end{algorithmic}
\end{algorithm}

