		int arr[]={1,5,3,4,5,6};
		int shift=0;
		int loop=0;
		for(int i=0;i<arr.length-1-shift;i++)
		{
			loop++;
			arr[i+1]=arr[i+1+shift]; // first shift
			if(arr[i+1]<arr[i])      //then compare
			{
				if((i+1) == arr.length-1-shift) // reached end of array
				{
					shift++;
					break;
				}
				if(i==0 || arr[i-1]<arr[i+1])
				{
					//remove i
					arr[i]=arr[i+1];
				}
				else
				{
					//remove i+1
					arr[i+1]=arr[i+1+shift];
				}
				shift++;
				//System.out.println(arr[i+1]);
				i=i-1;
			}
		}

		for(int i=0;i<arr.length-shift;i++)
		{
			System.out.print("  "+arr[i]);
		}
		System.out.println();
		System.out.println("No of Shifts: "+shift);
		System.out.println("array length: "+arr.length+" Count of Loop: "+loop);
	}

}

